import UploadExcelComponent from './components/UploadFile'
import { getName } from '@/utils/auth'
import { addcityeconomydata, addcitypopulationdata, addgarbagecity, addcitygarbagedeal, addcitygarbagecapacity, addcitygarbagevolume, 
addfacorylist, addtransferfactory, addcollectfactory, addelementgarbage, adddangerousgarbage, addgarbageclearperday, inputgarbagecountry, 
inputeconomydistrict, inputdistrictpopulation, inputgarbagedistrict } from '@/api/model'
export default {
  name: 'UploadExcel',
  components: { UploadExcelComponent },
  data() {
    return {
      tableData: [],
      tableHeader: [],
      hasData: false,
      area: '',
      kind: '',
      level_list: [
        {
          value: '1',
          label: '市级'
        },
        {
            value: '2',
            label: '区级'
        },
        {
            value: '3',
            label: '乡级'
        }
      ],
      kind_list: [
        {
          value: '1',
          label: '经济数据'
        },
        {
          value: '2',
          label: '人口数据'
        },
        {
          value: '3',
          label: '固废产量信息'
        },
        {
          value: '4',
          label: '无害化处理厂数量'
        },
        {
          value: '5',
          label: '无害化处理能力'
        },
        {
          value: '6',
          label: '无害化处理量'
        },
        {
          value: '7',
          label: '无害化处理厂信息'
        },
        {
          value: '8',
          label: '垃圾中转站信息'
        },
        {
          value: '9',
          label: '垃圾收集点信息'
        },
        {
          value: '10',
          label: '固废成分信息'
        },
        {
          value: '11',
          label: '危险废弃物数据'
        },
        {
          value: '12',
          label: '日均清运量'
        },
        {
          value: '13',
          label: '乡镇垃圾产量表'
        }
      ],
      star: null,
      table_loading: false
    }
  },
  methods: {
    beforeUpload(file) {
      const isLt1M = file.size / 1024 / 1024 < 1

      if (isLt1M) {
        return true
      }
      this.$message({
        message: 'Please do not upload files larger than 1m in size.',
        type: 'warning'
      })
      return false
    },
    handleSuccess({ results, header }) {
      this.tableData = results
      this.tableHeader = header
      this.hasData = true
    },
    DataInput(func){
      var that = this;
      this.table_loading = true
      const table = []
      for (let i = 0; i < this.tableData.length; i++) {
        table.push(this.tableData[i])
      }
      const data = {}
      data['data'] = table
      func(data).then(res => {
        that.table_loading = false
        if (res.code === 20000) {
          this.$message({
            type: 'success',
            message: '导入数据成功'
          })
        } else {
          this.$message.error(res.message)
          that.table_loading = false
        }
      }).catch(res => {
        console.log(res)
        that.table_loading = false
      })
    },
    AddModel: function() {
      var that = this
      if (that.area === '') {
        that.$message.error('数据级别不能为空')
      } else if (that.kind === '') {
        that.$message.error('数据表类型不能为空')
      } else {
        if (that.area === '1' && that.kind === '1') {
          this.DataInput(addcityeconomydata)
        } 
        else if (that.area === '1' && that.kind === '2') {
          this.DataInput(addcitypopulationdata)
        } 
        else if (that.area === '1' && that.kind === '3') {
          this.DataInput(addgarbagecity)
        } 
        else if (that.area === '1' && that.kind === '4') {
          this.DataInput(addcitygarbagedeal)
        } 
        else if (that.area === '1' && that.kind === '5') {
          this.DataInput(addcitygarbagecapacity)
        } 
        else if (that.area === '1' && that.kind === '6') {
          this.DataInput(addcitygarbagevolume)
        }
        else if (that.area === '1' && that.kind === '7') {
          this. DataInput(addfacorylist)
        }
        else if (that.area === '1' && that.kind === '8') {
          this.DataInput(addtransferfactory)
        }
        else if (that.area === '1' && that.kind === '9') {
          this.DataInput(addcollectfactory)
        }
        else if (that.area === '1' && that.kind === '10'){
          this.DataInput(addelementgarbage)
        }
        else if (that.area === '1' && that.kind === '11'){
          this.DataInput(adddangerousgarbage)
        }
        else if (that.area === '1' && that.kind === '12'){
          this.DataInput(addgarbageclearperday)
        }
        else if (that.area === '3' && that.kind === '13'){
          this.DataInput(inputgarbagecountry)
        }
        else if (that.area === '2' && that.kind === '1'){
          this.DataInput(inputeconomydistrict)
        }
        else if (that.area === '2' && that.kind === '2'){
          this.DataInput(inputdistrictpopulation)
        }
        else if (that.area === '2' && that.kind === '3'){
          this.DataInput(inputgarbagedistrict)
        }
      }
    }
  }
}
